        "urls" : [ ],
        "text" : "🇪🇺 Demonstrations are great! However we also need to show Poland what a European identity is, what the #EU stands for. If not, EU supporters in Poland will lose hope in the European dream. \nTime for a clear, Lisbon treaty, message to Poland and Hungary: The rule of law (European Law) in the EU or go to Article 50.  🇭🇺\n\n→ Is there no European Prosecutor that takes more of an initiative to prosecute non-compliance with European Directives decided by the European Parliament.  \n→ Are there still no guidelines on how to punish offender-countries? \n\nWithout rule of law, society turns to self doubt, fear and anarchy. \n\nWe need European #justice now before we all start to forget what Europe, the EU, stands for.  \n\nAsk yourself today: do you still recognize in the EU what 6 countries started on March 25, 1957 with the Treaty of Rome? Will there be a place for a Miterand-Kohl moment in our future, where 2 old time foo's, Germany and France reconcile, truly reconcile,  and solidify the foundation of our prosperity and peace that we enjoy in a free and democratic Europe today. \n\nDo we know enough to move forward?\nWill Poland be able set aside the animosity towards Germany for instance? 6.000.000 Poles died in the war, Poland today, is still traumatized because of this (and the USSR) But maybe Germany is to, for that same reason? There is no rationalizing. There is no EURO amount big enough to compensate this human loss. How to continue to live next to your neighbor after all this death and destruction? We probably still don't know yet. Still we need to try harder to find out how we can live together in Europe. We need to try harder not to resent each other. Poland please tell us, please teach us what is in your soul today. 🇵🇱",
