        "text" : "\"The Weapon Shops of Isher\" by A.E. van Vogt was published in 1951.\n\nFor me, as a #TargetedIndividual the ideas in this book show parallels to our present day oppression and this hidden silent genocide/holocaust we suffer all over the globe while deranged abusers continue the roll out this totalitarian system with today's tools being synthetic #telepathy, #v2k #mindcontrol, psychological #manipulation to #torture, to condition, #brainwash and murder us. \n\nThe idea in this book made me think about this system that sells rebrands, what is in fact oppression.  Ideals of Freedom, Justice and Respect easily sell to its citizens telling them this narative and by giving the masses the tools, weapons, that each citizen can use  to bring his or her own justice: the concept that now people have the freedom and tools directly themselves to bring justice, order and respect. For the masses this is in fact closer to anarchy but the reality distortion field of the elite that run this system hypnotises the regular citizens.  These \"elites\" carefully cultivating  high ideals into the ultimate emancipation where each individual brings fair justice with his or her own weapon thanks to the freedom their system and their system alone can grant. The elite few run this system are religiously adored almost as deities for bringing, the supposed highest ever achieved emancipation, and off course also for keeping this system up and running i.e. controlling the whole system, the whole world  and controlling the real society underneath.  \n\nIn today's world this invisible abuse of TI's and other so designated, must suffer while a global fascist dictatorship is silently taking over the power through our existing institutions, politiciens and leaders. \n\nWhy won't we again, not see what happened in 1933, now ninety years ago in democratic Germany: Hitler's, NSDAP, nazi party, took total power without even having a majority in government. \n\nhttps://t.co/YxOedBaP8z",
