        "text" : "Reminds me of always staying aware of your emotional state vs pure rational/logical thinking. (it really is a spectrum where one balances out the other)\n- HIGH EMOTION ➡️ LESS RATIONAL\n- LESS EMPATHY ➡️ MORE LOGICAL\nWhen you feel intens emotions like fear or pain you are less able to stay rational and it unknowingly (often not wanting) you are no longer rational ➡️ your logic becomes flawed and incomplete ➡️ judgement and ability to correctly assess a situation becomes biased and impaired by extreme intense emotions \n⚠️YOU ARE IN DANGER!‼️‼️⁉️",
