        "text" : "Free speech is not something you can boil down to a simple law or rule of thumb to then always know what goes and what does not. \nThough if we remember to treat all people with #RESPECT we should be good on most #free_speech issues don't you think?\nBeing cautious, being polite, when you don't know another person are ways to show respect. Staying respectful when you start to get to know someone requires a bit of time and attention to get to know the other person and allow the other person get to know you: #Mutual_Respect 🧑🏻👨🏽👩🏾‍🦱🧑🏿‍🦱👨🏻‍🦱🧕🏼👩‍🦳👧🏼",
