        "text" : "When complete disaster strikes, when everyone is suffering absolutely everywhere, you better make sure there is not a large enough group that remains unaffected. \n🔥❤️‍🔥🔥❤️‍🔥🔥❤️‍🔥🔥❤️‍🔥🔥❤️‍🔥🔥❤️‍🔥🔥❤️‍🔥🔥❤️‍🔥🔥❤️‍🔥\nWhen misery is everywhere on the planet, then you need equality in misery and the misery must affect every single person, human, people, race, country equally! Just like during the covid19 pandemic.\n💣💣💣💣💣💣💣💣💣💣💣💣💣💣💣💣💣💣\nThink of it as if you were to re-engineer Black Monday today. What happened in 1929?  \n🤔🤔🤔🤔🤔🤔🤔🤔🤔🤔🤔🤔🤔🤔🤔🤔🤔🤔\nCan everyone be made to care, really care, before everything gets to far out of control?\n💕❤️‍🔥💕❤️‍🔥💕❤️‍🔥💕❤️‍🔥💕❤️‍🔥💕❤️‍🔥💕❤️‍🔥💕❤️‍🔥💕❤️‍🔥\nIf not you risk having those who don't suffer (much) and don't have to care, using the suffering of others as a business opportunity. This will make others that are already on their knees suffer even more without realizing in time that those of them are now competing in this new parasitic business opportunity are soon the only ones left to exploit, to exploit themselves. The end.",
