        "text" : "Here's another souvenir for the #Obama family. 13 years ago. This was a #StreetArt painting in Shanghai, China.  The world seemed more at peace back then. A sitting #US President on a street wall in #Communist #China. Imagine this today!?  Back then in 2010, bf and I were in Shanghai, China's 2nd city. We did not have a Trade War with China, instead China held a World Expo in #Shanghai. The US got #ObamaCare (ACA) but that took all our attention (...and a lot of anger from some others...). \nHOPE really brought CHANGE, but it wasn't enough for everyone. Too much hate and resentment still lingers. Did one-sided change in DC then, help stoke one-sideness on the global stage today? (Ukraine, Trade War, ...) \nThe world seems more close-minded and #protectionist now then ever b4. The USA still leads the world, but it is not the leadership we all need. Where is the hope and the change for today's problems. Maybe the job back then wasn't quiet finished. Maybe we lost sight of precisely that and have lost perspective today. \nFor today's problems we should have another Obama moment for the whole world ➡️ Muster all that hope for change from every corner of the planet, so:\n➠ Leaders of the world can find a way! \n➠ We can still act today!\n➠ \"Yes we can\" still do this together! \n➠ Make this work so we may have another day. \n\n#YesWeCan still save us #humans and the #planet.",
