        "text" : "You are right. Europe is a project of peace. It was never meant to be a central government to rule 27 countries so they and their people become more and more the same. With our diversities, identities, cultures, languages intact, perhaps even strengthent, we should discover that we can prosper more because of these. Differences, diversity, give us more and different ideas. We can learn more, we can become more confident, can choose to be more creative and more innovative for a better future, without all this fear of bad things from our past happening again. I really hope to understand more how different we are, people of Europe and what makes each of us tick. Would be nice to take away some of those old fears and find out instead what and who we can really trust.",
