        "text" : "I never considered being gay as a political thing left or right. Interesting how you link sexuality, openness, to political stance that conflict with preserving  traditional values and identity.  Never thought looking at the world that way. But of course, I am gay, I did not choose to be gay. Politically I consider myself a liberal/right and definitely not a socialist, what we would call the left here.\nIn many countries it is still illegal, punishable to be gay. Gay Pride, tries to make more people aware of this. We cannot change the part of us that was given to us by nature.  We can only accept it, accept oneself, and hope others can accept who you are, who I am, who we are. #identity",
