        "text" : "[=1984=] I'm 8.  Orwell's doom, The first Mac.\n\n[=1985=] I'm 9. Hugo Clause write's this poem: Envoi (see below) in Dutch. Since then and for the 23 years following, we knew and we know.  Our greatest writer died by his own choice (euthanasia) in 2008. For years and years he had been considered a candidate winner of the Nobel Prize for Literature - for years and years.\n\n[=2018=] The company I worked for lost a colleague due to suicide in our Manila office. \n\n[=2023=] I'm 46. The year is almost over and what will we bring to the rest of humanity? The sadness we know in Belgium for not having the rest of the world see, listen to us or read about and know us.  And most of all learn from our suffering, our mistake so they won't have to all over again. Last October I turned 47.\n\n[=2024=] My sickness did not get better. My suffering did stop. Looks like 47 years old I stayed. Will it also be so hard to search online and find out what happened to me here in Brussels? It was very hard to still find anything at all about what happened in the Philippines in 2018 at the Alight (NGA) offices located at Eton Centris Cyberpod Five Corinthian, Oritigas Avenue, Corner EDSA 1100 Quezon City metro Manila where a former colleague died. She jumped out of the fourth floor offices.\n \nIf you know Dutch, check the poem below. If not, check the song in English by Absinth Minded with the same text and the same title: Envoi.\n\n@cia @NSAGov \n@knuff\n@IvanMostien\n@StephanScholl \n@Snowden \n@mfa_russia @ericfranckx\n@YairNetanyahu @gregtutt @TarikFadliSays",
