        "text" : "What if the developing kinetic energy from the big bang explosion makes all matter in the universe accelerate beyond the speed of light? \n\nThe big bang really could have that much energy to force all things beyond the universal constant (c) of 300.000kph. At that speed, with e=m.c² you get a whole lot of energy!!! \nSo then all matter turns into energy or a \"big flash\" which leads up to and precedes the next big bang. \n\nIt is not because kinetic energy has fully developed that acceleration stops, only the increase in acceleration stops. \nThis could give a relative perception of a slow down. \n\nTo understand this better, think of the bullet that leaves the barrel of a gun. It's initial speed is zero kph, at some point it reached the speed where all the kinetic energy that the mass of the bullet can hold has been released/developed but it still accelerates but only more slowly. When this decrease in acceleration is done, only then, the bullet starts to decelerate. \n\nAll this being said and assumed in my hypothesis, this means that for the universe to exist and to be able for it to reincarnate from one big bang into the next, that each big bang must be so tremendously powerful an explosion, that there is no other outcome then for all matter that exists to turn into energy which keeps the cycle going (cfr. beating hearth theory for big bang)♻️ #theory_of_everything #QGFI",
