        "text" : "Pindy’s main habitat is northern Australia. Some have imagined sighting’s around Darwin. Pindy’s, like penguin’s are excellent swimmers. One’s a year on February 28th, they migrate north by swimming the Pacific ocean. If the plankton in the water, that btw provide 80% of oxygen to the planet (photosynthesis like trees) are blossoming, they are able to glide while swimming. Not unlike a slipstream in cycling races: in one curvy line.\nIn water, this slip stream gliding, is called aqua planning. \nAbove the water surface pindy’s have also been known to use the jet stream when weather permits. This combination doubles their speed to a “jet set”, a combination of 2 propulsions: swim-plain and wind-cambering. They are frequent flyers above the sea. It doesn’t always have to be miles high, just above the waves, skimming off the top. \nSometimes refraction of the sun allows to see them as a flat rainbow 🌈. At night military satellite radar systems shows magnetism on the curvy line of pindy’s. Scientists are not sure how this can be. However this might be magnetism with enough energy to glow like the northern light (aurora borealis) in the sky. Soon science hopes to witness this eroris-vide-soummarins. Golden brown glow visible to the naked eye.\nJokingly, some refer to is as glowing shit.",
