        "text" : "Oh, no here comes my theory about aliens... our children\nhttps://t.co/rGP8DDARJK\nwe were already long gone, they are our final evolution at the end of time, soon they will come back in time.\nImagine if you could go back to the beginning of human civilization and tell everyone what we've learned, what mistakes, what wisdom should have learned earlier?\n\nwould you still give them all the science and tech stuff 2100 years ago so they can also blow things up earlier?\n\n-100 Julius Ceasar might have invented the steam engine. \n+200 Industrialization might have spread with Christianity. \n+500 West Roman Empire falls due to depleted natural resources. Pollution, of sea, drinking water makes everyone sick. Only the rich have access to healthy food, shelter and pay garrisons of soldiers to protect their villas. \n+800 Islam rises from the slums to stop exploitation and slaves working without pay. No pay ever. Factories already produce electric cars.\nNow also the poor read and write but Arabic.\n+1000 Trade, industry, it's not enough. War breaks out over just about everything all over the planet. Weapons race is on. \n+1200 The colonies rebel and develop newer weapons. Rockets kill out of nowhere. \n+1303 Starts an intercontinental rockets war\n+1492 Ends the war introducing rockets with atomic warheads\n+1493 one year and 500+ nukes later, nuclear holocaust. mankind is near extinct.\n\n2024 The rubble clears, some live returns, not unlike 2100 earlier.\n#km4more",
