        "urls" : [ ],
        "text" : "Prevention is better than cure. Look for signs early.\n\nInstitutionalized toxic workplaces become part of the companies system and business model. It spreads like a pandemic. Managers fight against other managers for the best resources (this fight also costs resources). Ones such bullies succeed in their manipulation, and nobody acts or even notices, they do it again and so do other managers become copy-cats.  It spreads across an industry, across company culture and further in society. Fighting becomes the bottom line. No more financial goals, no more human dignity, no need for mental healthcare, no productivity. Especially services oriented and commodity markets are more susceptible. \n\nWhen these markets become low margin commodity selling marktes, the economic laws, reduce competition, the leads to less innovation, less investor interest, no pressure from anywhere. If the market you are in is going through consolidation phase pay attention. \n\nYet another owner, from say a PE. Not that much later they cut their losses and sell to fancy bank. Now piece by piece sell out. Again the owners are just worried about how much they will lose. Maybe the bank gets a bonus for limiting an estimated loss. Management knows and tries to come up with the next make-believe-change. Much needed change at the top is not immune, the next new execs that fall for their promises. Maybe new fresh execs even become victim of the toxicity: \n1. you did miracles last time\n2. so easy, only you can do it \n3. becomes only politics \n4. becomes leverage somehow towards \"higher-ups\"\n\n else to change the toxic environment into what all knows. In what I had to go through they even seemed to have a sort of playbook with tactics to weaken the position of the employee. Think about bullying also in these ways:\n- you come from leave and, oops, someone destroyed 16 years of all your digital documents with your new laptop because of something weird with \"the cloud\" (Office365). Hard to believe, still I carry on \n- Welcome to your new job position, you get no - Line managers find it no longer useful to give you a job description with excuses \"oh you're senior enough\" why bother.learning and all you ever did is lost in the cloud.\n- When reporting issues they start mediation through an HRBP of a different country to avoid local HR legislation as long as possible.\n- When I decided myself and submitted my resignation they found a way to pretend not to accept it. Means in effect they refused my resignation. Who ever thought that was possible when you clearly feel that you are no longer wanted. \n- But 2 months later they fire you themselves.\n- I already prepared for problems involving my lawyers before resigning, turns out they invested resources in their own local-super-lawyers.  They succeed in writing 16 pages motivating why they need to fire me. It sums up in: \"You're a worthless person you never did anything of value\".  They must have taken the time to get input for this letter from the whole BU team (50+ people). The written (English) language style is agressive, exageration, hyperbolic everywhere. They now call this \"Legal Slapping\" in the US. Clearly all ment to intimidate.  Know that it is a crime.\n\nI was ready to leave the next day after resigning. I was ready to leave at no additional cost for the employer. (legally I could have asked for 1,5year salary/notice period) \nThey decided to keep on beating me up mentally another 2 months, costing the employer 2 months salary.\n\nIt is crazy how far they are willing to go. Ugly is what I call them now. What humans do this to other humans?\nIT-HR Services was the business I was in. \n\nColleagues I respected and liked did not dare to speak up.  Eventually I spoke up on lnkin. 20+ former empoloyees found my story striking and even recognized the same abuser, now serial abuser. \n\nFinally I found the courage to speak up and publish an article on linkedin.  I got sued for slander. 4 months earlier, I gave them a draft, the CEO replied looking into it. They had 4 months they could have just asked not to publish. Who knows maybe we could try have figured out how things could have gone so wrong. People get pushed all the way to suicide. That is not the same as murder or is manslaughter still not quiet right. Why I still ask myself do they do this?  (feel free to DM)",
